import React from 'react';
import styled from 'styled-components';

const AddGoalContainer = styled('div')`
    width: 48px;
    height: 48px;
    background-color: green;
    position: fixed;
    right: 16px;
    bottom: 32px;
    border-radius: 50%;
    display: grid;
    align-items: center;
    justify-items: center;
`;

const TextStyled = styled(Text)`
    color: #fff;
`;

export default class AddGoal extends React.PureComponent {
    render () {
        return (
            <AddGoalContainer>
                <span>+</span>
            </AddGoalContainer>
        )
    }
}
